#' InputConfig Object
#' 
#' @details 
#' Autogenerated via \code{\link[googleAuthR]{gar_create_api_objects}}
#' Input configuration for ImportData Action.The format of input depends on dataset_metadata the Dataset into whichthe import is happening has. As input source thegcs_sourceis expected, unless specified otherwise. Additionally any input .CSV fileby itself must be 100MB or smaller, unless specified otherwise.If an 'example' file (that is, image, video etc.) with identical content(even if it had different GCS_FILE_PATH) is mentioned multiple times, thenits label, bounding boxes etc. are appended. The same file should be alwaysprovided with the same ML_USE and GCS_FILE_PATH, if it is not, thenthese values are nondeterministically selected from the given ones.The formats are represented in EBNF with commas being literal and withnon-terminal symbols defined near the end of this comment. The formats are: *  For Image Classification:        CSV file(s) with each line in format:          ML_USE,GCS_FILE_PATH,LABEL,LABEL,...          GCS_FILE_PATH leads to image of up to 30MB in size. Supported          extensions: .JPEG, .GIF, .PNG, .WEBP, .BMP, .TIFF, .ICO          For MULTICLASS classification type, at most one LABEL is allowed          per image. If an image has not yet been labeled, then it should be          mentioned just once with no LABEL.        Some sample rows:          TRAIN,gs://folder/image1.jpg,daisy          TEST,gs://folder/image2.jpg,dandelion,tulip,rose          UNASSIGNED,gs://folder/image3.jpg,daisy          UNASSIGNED,gs://folder/image4.jpg *  For Image Object Detection:        CSV file(s) with each line in format:          ML_USE,GCS_FILE_PATH,(LABEL,BOUNDING_BOX | ,,,,,,,)          GCS_FILE_PATH leads to image of up to 30MB in size. Supported          extensions: .JPEG, .GIF, .PNG.          Each image is assumed to be exhaustively labeled. The minimum          allowed BOUNDING_BOX edge length is 0.01, and no more than 500          BOUNDING_BOX-es per image are allowed (one BOUNDING_BOX is defined          per line). If an image has not yet been labeled, then it should be          mentioned just once with no LABEL and the ',,,,,,,' in place of the          BOUNDING_BOX. For images which are known to not contain any          bounding boxes, they should be labelled explictly as          'NEGATIVE_IMAGE', followed by ',,,,,,,' in place of the          BOUNDING_BOX.        Sample rows:          TRAIN,gs://folder/image1.png,car,0.1,0.1,,,0.3,0.3,,          TRAIN,gs://folder/image1.png,bike,.7,.6,,,.8,.9,,          UNASSIGNED,gs://folder/im2.png,car,0.1,0.1,0.2,0.1,0.2,0.3,0.1,0.3          TEST,gs://folder/im3.png,,,,,,,,,          TRAIN,gs://folder/im4.png,NEGATIVE_IMAGE,,,,,,,,, *  For Video Classification:        CSV file(s) with each line in format:          ML_USE,GCS_FILE_PATH          where ML_USE VALIDATE value should not be used. The GCS_FILE_PATH          should lead to another .csv file which describes examples that have          given ML_USE, using the following row format:          GCS_FILE_PATH,(LABEL,TIME_SEGMENT_START,TIME_SEGMENT_END | ,,)          Here GCS_FILE_PATH leads to a video of up to 50GB in size and up          to 3h duration. Supported extensions: .MOV, .MPEG4, .MP4, .AVI.          TIME_SEGMENT_START and TIME_SEGMENT_END must be within the          length of the video, and end has to be after the start. Any segment          of a video which has one or more labels on it, is considered a          hard negative for all other labels. Any segment with no labels on          it is considered to be unknown. If a whole video is unknown, then          it shuold be mentioned just once with ',,' in place of LABEL,          TIME_SEGMENT_START,TIME_SEGMENT_END.        Sample top level CSV file:          TRAIN,gs://folder/train_videos.csv          TEST,gs://folder/test_videos.csv          UNASSIGNED,gs://folder/other_videos.csv        Sample rows of a CSV file for a particular ML_USE:          gs://folder/video1.avi,car,120,180.000021          gs://folder/video1.avi,bike,150,180.000021          gs://folder/vid2.avi,car,0,60.5          gs://folder/vid3.avi,,, *  For Video Object Tracking:        CSV file(s) with each line in format:          ML_USE,GCS_FILE_PATH          where ML_USE VALIDATE value should not be used. The GCS_FILE_PATH          should lead to another .csv file which describes examples that have          given ML_USE, using one of the following row format:          GCS_FILE_PATH,LABEL,[INSTANCE_ID],TIMESTAMP,BOUNDING_BOX          or          GCS_FILE_PATH,,,,,,,,,,          Here GCS_FILE_PATH leads to a video of up to 50GB in size and up          to 3h duration. Supported extensions: .MOV, .MPEG4, .MP4, .AVI.          Providing INSTANCE_IDs can help to obtain a better model. When          a specific labeled entity leaves the video frame, and shows up          afterwards it is not required, albeit preferable, that the same          INSTANCE_ID is given to it.          TIMESTAMP must be within the length of the video, the          BOUNDING_BOX is assumed to be drawn on the closest video's frame          to the TIMESTAMP. Any mentioned by the TIMESTAMP frame is expected          to be exhaustively labeled and no more than 500 BOUNDING_BOX-es per          frame are allowed. If a whole video is unknown, then it should be          mentioned just once with ',,,,,,,,,,' in place of LABEL,          [INSTANCE_ID],TIMESTAMP,BOUNDING_BOX.        Sample top level CSV file:          TRAIN,gs://folder/train_videos.csv          TEST,gs://folder/test_videos.csv          UNASSIGNED,gs://folder/other_videos.csv        Seven sample rows of a CSV file for a particular ML_USE:          gs://folder/video1.avi,car,1,12.10,0.8,0.8,0.9,0.8,0.9,0.9,0.8,0.9          gs://folder/video1.avi,car,1,12.90,0.4,0.8,0.5,0.8,0.5,0.9,0.4,0.9          gs://folder/video1.avi,car,2,12.10,.4,.2,.5,.2,.5,.3,.4,.3          gs://folder/video1.avi,car,2,12.90,.8,.2,,,.9,.3,,          gs://folder/video1.avi,bike,,12.50,.45,.45,,,.55,.55,,          gs://folder/video2.avi,car,1,0,.1,.9,,,.9,.1,,          gs://folder/video2.avi,,,,,,,,,,, *  For Text Extraction:        CSV file(s) with each line in format:          ML_USE,GCS_FILE_PATH          GCS_FILE_PATH leads to a .JSONL (that is, JSON Lines) file which          either imports text in-line or as documents. Any given          .JSONL file must be 100MB or smaller.          The in-line .JSONL file contains, per line, a proto that wraps a          TextSnippet proto (in json representation) followed by one or more          AnnotationPayload protos (called annotations), which have          display_name and text_extraction detail populated. The given text          is expected to be annotated exhaustively, for example, if you look          for animals and text contains 'dolphin' that is not labeled, then          'dolphin' is assumed to not be an animal. Any given text snippet          content must be 10KB or smaller, and also be UTF-8 NFC encoded          (ASCII already is).          The document .JSONL file contains, per line, a proto that wraps a          Document proto. The Document proto must have either document_text          or input_config set. In document_text case, the Document proto may          also contain the spatial information of the document, including          layout, document dimension and page number. In input_config case,          only PDF documents are supported now, and each document may be up          to 2MB large. Currently, annotations on documents cannot be          specified at import.        Three sample CSV rows:          TRAIN,gs://folder/file1.jsonl          VALIDATE,gs://folder/file2.jsonl          TEST,gs://folder/file3.jsonl        Sample in-line JSON Lines file for entity extraction (presented here        with artificial line breaks, but the only actual line break is        denoted by \n).:          {            'document': {              'document_text': {'content': 'dog cat'}              'layout': [                {                  'text_segment': {                    'start_offset': 0,                    'end_offset': 3,                  },                  'page_number': 1,                  'bounding_poly': {                    'normalized_vertices': [                      {'x': 0.1, 'y': 0.1},                      {'x': 0.1, 'y': 0.3},                      {'x': 0.3, 'y': 0.3},                      {'x': 0.3, 'y': 0.1},                    ],                  },                  'text_segment_type': TOKEN,                },                {                  'text_segment': {                    'start_offset': 4,                    'end_offset': 7,                  },                  'page_number': 1,                  'bounding_poly': {                    'normalized_vertices': [                      {'x': 0.4, 'y': 0.1},                      {'x': 0.4, 'y': 0.3},                      {'x': 0.8, 'y': 0.3},                      {'x': 0.8, 'y': 0.1},                    ],                  },                  'text_segment_type': TOKEN,                }              ],              'document_dimensions': {                'width': 8.27,                'height': 11.69,                'unit': INCH,              }              'page_count': 1,            },            'annotations': [              {                'display_name': 'animal',                'text_extraction': {'text_segment': {'start_offset': 0,                'end_offset': 3}}              },              {                'display_name': 'animal',                'text_extraction': {'text_segment': {'start_offset': 4,                'end_offset': 7}}              }            ],          }\n          {             'text_snippet': {               'content': 'This dog is good.'             },             'annotations': [               {                 'display_name': 'animal',                 'text_extraction': {                   'text_segment': {'start_offset': 5, 'end_offset': 8}                 }               }             ]          }        Sample document JSON Lines file (presented here with artificial line        breaks, but the only actual line break is denoted by \n).:          {            'document': {              'input_config': {                'gcs_source': { 'input_uris': [ 'gs://folder/document1.pdf' ]                }              }            }          }\n          {            'document': {              'input_config': {                'gcs_source': { 'input_uris': [ 'gs://folder/document2.pdf' ]                }              }            }          } *  For Text Classification:        CSV file(s) with each line in format:          ML_USE,(TEXT_SNIPPET | GCS_FILE_PATH),LABEL,LABEL,...          TEXT_SNIPPET and GCS_FILE_PATH are distinguished by a pattern. If          the column content is a valid gcs file path, i.e. prefixed by          'gs://', it will be treated as a GCS_FILE_PATH, else if the content          is enclosed within double quotes (''), it is          treated as a TEXT_SNIPPET. In the GCS_FILE_PATH case, the path          must lead to a .txt file with UTF-8 encoding, for example,          'gs://folder/content.txt', and the content in it is extracted          as a text snippet. In TEXT_SNIPPET case, the column content          excluding quotes is treated as to be imported text snippet. In          both cases, the text snippet/file size must be within 128kB.          Maximum 100 unique labels are allowed per CSV row.        Sample rows:          TRAIN,'They have bad food and very rude',RudeService,BadFood          TRAIN,gs://folder/content.txt,SlowService          TEST,'Typically always bad service there.',RudeService          VALIDATE,'Stomach ache to go.',BadFood *  For Text Sentiment:        CSV file(s) with each line in format:          ML_USE,(TEXT_SNIPPET | GCS_FILE_PATH),SENTIMENT          TEXT_SNIPPET and GCS_FILE_PATH are distinguished by a pattern. If          the column content is a valid gcs file path, that is, prefixed by          'gs://', it is treated as a GCS_FILE_PATH, otherwise it is tr